var atendimentoPermanente =
  atendimentoPermanente === undefined ? null : atendimentoPermanente;

function get_atendimento_permanente() {
  if (atendimentoPermanente !== null) {
    atendimento_permanente(atendimentoPermanente);
    return;
  }
  jQuery.ajax({
    url: jQuery("[data-er-link]").first().attr("data-er-link"),
    type: "POST",
    crossDomain: true,
    dataType: "json",
    success: function (result) {
      var map = JSON.parse(result);
      var retval = [];
      for (var i = 0, l = map.length; i < l; i++) {
        try {
          var site = map[i].ug || map[i].up;
          retval[site.site] = map[i];
        } catch (e) {}
      }
      atendimentoPermanente = retval;
      atendimento_permanente(retval);
    },
    error: function (xhr, status, error) {
      atendimento_permanente(null);
    },
  });
}

function atendimento_permanente(ERWaitingTimes) {
  jQuery(".er-waiting-times").each(function () {
    var er = String(jQuery("[data-er]", this).attr("data-er"));
    var ug = (up =
      "<span>" + Drupal.t("Informao no disponvel.") + "</span>");
    if (ERWaitingTimes) {
      if (ERWaitingTimes[er] && ERWaitingTimes[er].ug) {
        var hours = Math.floor(ERWaitingTimes[er].ug.waitingTime / 60);
        var minutes = ERWaitingTimes[er].ug.waitingTime % 60;
        ug = hours + "h" + (minutes < 10 ? "0" + minutes : minutes) + "m";
      } else {
        ug = "<span>" + jQuery("[data-er]", this).attr("data-ug") + "</span>";
      }
      if (ERWaitingTimes[er] && ERWaitingTimes[er].up) {
        var hours = Math.floor(ERWaitingTimes[er].up.waitingTime / 60);
        var minutes = ERWaitingTimes[er].up.waitingTime % 60;
        up = hours + "h" + (minutes < 10 ? "0" + minutes : minutes) + "m";
      } else {
        up = "<span>" + jQuery("[data-er]", this).attr("data-up") + "</span>";
      }
    }
    jQuery(".er-ug span", this).html(ug);
    jQuery(".er-up span", this).html(up);
  });
}

